import React from "react";
import Header from "../Components/Header";
import About from "../Components/About";
class ContactPage extends React.Component {
  constructor(props) {
    super();
    this.state = {
      name: "",
      email: "",
      message: "",
      disable: false,
      emailSent: null,
    };
  }

  render(props) {
    return (
      <div>
        <Header mainHeader={this.props.mainHeader} />
      </div>
    );
  }
}

export default ContactPage;
